var abbrev=require("./abbrev.js");var assert=require("assert");var util=require("util");console.log("TAP version 13");var count=0;function test(b,a){count++;var c=abbrev(b);assert.deepEqual(c,a,"abbrev("+util.inspect(b)+") === "+util.inspect(a)+"\nactual: "+util.inspect(c));c=abbrev.apply(exports,b);assert.deepEqual(abbrev.apply(exports,b),a,"abbrev("+b.map(JSON.stringify).join(",")+") === "+util.inspect(a)+"\nactual: "+util.inspect(c));console.log("ok - "+b.join(" "))}test(["ruby","ruby","rules","rules","rules"],{rub:"ruby",ruby:"ruby",rul:"rules",rule:"rules",rules:"rules"});test(["fool","foom","pool","pope"],{fool:"fool",foom:"foom",poo:"pool",pool:"pool",pop:"pope",pope:"pope"});test(["a","ab","abc","abcd","abcde","acde"],{a:"a",ab:"ab",abc:"abc",abcd:"abcd",abcde:"abcde",ac:"acde",acd:"acde",acde:"acde"});console.log("1..%d",count);